--listing changes
SELECT 
  S.SpcRecID, L.LegListing, L.LegDateListed, C.CtyRecID, L.LegNotes
FROM ORWELL.animals.dbo.species AS S
  INNER JOIN ORWELL.animals.dbo.genus AS G ON S.SpcGenRecID = G.GenRecID 
  INNER JOIN ORWELL.animals.dbo.family AS F ON G.GenFamRecID = F.FamRecID 
  INNER JOIN ORWELL.animals.dbo.taxorder AS O ON F.FamOrdRecID = O.OrdRecID 
  INNER JOIN ORWELL.animals.dbo.taxclass AS CL ON O.OrdClaRecID = CL.ClaRecID
  LEFT JOIN ORWELL.animals.dbo.legal AS L ON S.SpcRecID = L.LegSpcRecID
  LEFT JOIN ORWELL.animals.dbo.legalname AS LN ON L.LegLnmRecID = LN.LnmRecID
  LEFT JOIN ORWELL.animals.dbo.Country as C ON L.LegISO2 = C.CtyISO2
WHERE S.SpcStatus = 'A' AND ClaName = 'MAMMALIA' AND (LN.LnmRecID IS NULL OR LN.LnmRecID = 3)
ORDER BY S.SpcRecID;

-- taxon concepts
SELECT 'Animalia' as Kingdom , P.PhyName, C.ClaName, O.OrdName, F.FamName, G.GenName, S.SpcName, S.SpcInfraRank, S.SpcInfraEpithet, S.SpcRecID, S.SpcStatus
from Orwell.animals.dbo.Species S 
inner join Orwell.animals.dbo.Genus G on S.Spcgenrecid = G.genrecid
INNER JOIN	ORWELL.animals.dbo.Family F ON FamRecID = GenFamRecID
INNER JOIN  ORWELL.animals.dbo.TaxOrder O ON OrdRecID = FamOrdRecID
INNER JOIN  ORWELL.animals.dbo.TaxClass C ON ClaRecID = OrdClaRecID
INNER JOIN  ORWELL.animals.dbo.TaxPhylum P ON PhyRecID = ClaPhyRecID
